  Tests_5:
    titulo: barsit
    enunciado: "Esta es una prueba que sirve para apreciar cómo piensa Ud. Contiene una serie de cuestiones sencillas que debe leerlas atentamente. Luego debe anotar en la línea de puntos de la derecha, la letra que esta antes de la palabra que Ud. Selecciona como la mejor respuesta. O bien, debe escribir los dos números que falten en cada serie. A continuación encontrara Ud. Cinco ejemplos para que comprenda como debe realizar este trabajo.\r\nEJEMPLO 1. ¿Qué palabra indica lo contrario de blanco?\r\na)	claro        b) obscuro        c) gris        d) negro        e) nítido			Ej. 1 ____ \r\nLo contrario de blanco es negro. La palabra negro lleva la letra d). Por consiguiente, debe Ud. escribir la letra d) en la línea de puntos de la derecha. ¡Hágalo¡ En esta misma forma seguirá contestando las demás cuestiones.\r\nEJEMPLO 2. ¿Qué palabra expresa mejor lo que es un martillo?\r\na)	metal        b) objeto        c) herramienta        d) cosa        e) útil 		Ej. 2 ____\r\nEJEMPLO 3. ¿Cuál de las siguientes palabras no pertenece al grupo?\r\na)	lápiz        b) zapato        c) cuaderno        d) libro        e) regla		Ej. 3 ____\r\nEJEMPLO 4. ¿Qué palabra significa lo mismo que responder?\r\na)	explicar      b) indagar      c) preguntar      d) contestar      e) decir		Ej. 4 ____\r\nEJEMPLO 5. Escriba los números que faltan en esta serie\r\n	10	12	14	__	18	20	22	__	26		Ej. 5 ____\r\nDe inmediato encontrara Ud. 60 cuestiones parecidas a las que acaba de resolver. Recuerde que cada vez tendrá que escribir una letra en el margen derecho de la hoja o bien, escribir los dos números que faltan en las series. Procure resolver el mayor número posible de cuestiones. Trabaje rápidamente, pero procure no equivocarse. No conteste las cuestiones que le parezcan muy difíciles o que le quiten mucho tiempo. No pregunte nada a nadie, ni se distraiga mirando lo que hacen las demás personas.\r\nUd. Tiene 30 minutos para resolver toda la prueba. Anote las respuestas con absoluta claridad, Cuando se equivoque, tache la letra mal escrita y a su lado vuelva a escribir la letra correcta.\r\n¡LISTO PARA COMENZAR!\r\n"
    duracion: '30 minutos'
    puntaje_aprobacion: '50'
    tipoopcion_id: Tipoopcion_4
