  Tests_15:
    titulo: 'razonamientoverbal '
    enunciado: "Esta prueba consta de frases o proposiciones a las que faltan la primera y la última palabras que se han sustituido por puntos. Su tarea consiste en encontrar las palabras que faltan de modo que, cuando se haya completado, la relación entre la primera y la segunda parte de cada frase sea semejante y la frase resulte verdadera y con sentido.\r\n\r\nPara ello ha de elegir entre los 5 pares de palabras que se proponen como opciones de respuesta. La primera palabra del par debe ir al principio de la frase y la segunda al final. Cuando haya elegido el par que, a su juicio, completa mejor la frase, debe fijarse en la letra que tiene delante y marcar el recuadro que está debajo de esa letra en la Hoja de respuestas.\r\n\r\nFíjese en el Ejemplo El:\r\n\r\n...es a maullar como perro es a...\r\n \r\n                                  A. ladrar - cachorro\r\n	                    B. gato – ladra\r\n                                  C. gato — morder\r\n	 D. foca - cazar\r\n	             E. arañar - hueso\r\n\r\nPara elegir la respuesta correcta al ejemplo El, examine atentamente cada par de palabras. Sólo uno de esos pares completará la frase de modo que los dos términos de la primera parte se relacionen entre sí de forma análoga a como se relacionan los de la segunda.\r\n\r\nLa respuesta A es incorrecta porque ladrar y maullar no se relacionan de la misma manera que perro y cachorro.\r\n\r\nLo mismo puede decirse de las respuestas D y E\r\n\r\nTampoco la respuesta C es buena, porque aunque el gato maullar y el perro muerde, las acciones son de distinto tipo.\r\n\r\nLa respuesta correcta es la B, porque gato y maullar se relacionan de modo semejante a como lo hacen perro y ladrar. Por eso, en la Hoja de respuestas, frente al Ejemplo El se ha marcado el recuadro que está debajo de la B\r\n\r\nFíjese en el Ejemplo E2:\r\n\r\n...es a derecha como oeste es a...\r\n \r\n                           A.  Izquierda - norte\r\n                           B.  dirección - este\r\n                           C.  izquierda - sur\r\n                           D.  diestra- dirección. 	\r\n                           E.  izquierda-este\r\n\r\nPara elegir la respuesta correcta al Ejemplo E2, considere cuidadosamente cada par de palabras. ¿Cuál de los pares completa la frase de modo que las dos primeras palabras de la misma se relacionen entre sí de la misma manera que las dos últimas?\r\n\r\nLa respuesta es E porque izquierda y derecha tienen entre sí la misma relación que oeste y este. Izquierda se opone a derecha como oeste se opone a este. Por eso ha debido marcar el espacio debajo de la letra E frente al Ejemplo E2 en la Hoja de respuestas.\r\n\r\nVea ahora el Ejemplo E3:\r\n\r\n...es a lapicero como tinta es a...\r\n\r\n                        A.	 goma - papel\r\n B.	   bolígrafo - color\r\nC.	papel - negro\r\nD.	mina – pluma\r\n                         E.	goma - rotulador\r\n\r\n\r\nPara dar la contestación correcta al Ejemplo E3 examine cuidadosamente cada par de palabras. ¿Cuál de las parejas completa la frase de modo que sus dos primeras palabras se relacionen entre sí de modo análogo a como lo hacen las dos últimas?\r\n\r\nLa respuesta es D, porque mina y lapicero tienen entre sí una relación semejante a la que existe entre tinta y pluma. La mina del lapicero y la tinta de la pluma producen marcas sobre el papel. Por eso ha debido marcar D frente al Ejemplo E3.\r\n\r\nRecuerde que en cada ejercicio tiene que elegir el par de palabras que mejor complete la frase de modo que las dos primeras palabras se relacionen entre sí de forma semejante a como lo hacen las dos últimas.\r\n\r\nSi tiene dificultad en contestar a algún ejercicio, déjelo y pase a otros que le parezcan más fáciles. Luego, si tiene tiempo, vuelva a los ejercicios que dejó sin contestar en esta prueba y trate de resolverlos. No continúe con la prueba siguiente hasta que se lo indiquen.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nDETÉNGASE Y ESPERE NUEVAS INSTRUCCIONES\r\n"
    tipoopcion_id: Tipoopcion_4
    tests_id: Tests_14
